fewshot.solution:
Gọi số ban đầu của Pete là $x$. Nếu anh ấy nhân đôi nó và cộng 10, anh ấy sẽ có $$2x+10.$$ Sau khi nhân với 4, Pete có 120. Từ thông tin này, chúng ta có phương trình: $$4(2x+10)=120.$ $ Khai triển vế trái và giải, ta tìm được:

\bắt đầu{căn chỉnh*}
8x+40&=120\\
\Rightarrow\qquad 8x&=80\\
\Rightarrow \qquad x&=\đóng hộp{10}.
\end{căn chỉnh*}
